import React, { useEffect } from 'react'
import { useNavigate, useParams } from 'react-router-dom'

function SingleJob() {
    let {id} = useParams()
    console.log(useParams())

    const navigate = useNavigate()
    console.log(id?'hello':"by")
    useEffect(()=>{
        if(!id){
            navigate("/asdf")
        }

    },[id])
  return (
    <div>SingleJob</div>
  )
}

export default SingleJob
